import http from "./http_common"

const getAll = () => {
    return http.get("/listgroup/")
}

const get = (nameofgroup) => {
    return http.get(`/group/${nameofgroup}`)
}

const createGroupToServer = (arr) => {
    return http.post("/createpage/" + {
        arr
    })
}

export default {
    getAll,
    get,
    createGroupToServer,
}
